import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const ChallengePage = () => {
  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [score, setScore] = useState(0);
  const [showScore, setShowScore] = useState(false);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [isCorrect, setIsCorrect] = useState(null);
  const [showExplanation, setShowExplanation] = useState(false);
  const navigate = useNavigate();

  const challengeQuestions = [
    {
      question: "If 6 × (3 + 4) = (6 × 3) + (6 × 4), which property is being demonstrated?",
      property: "Distributive Property",
      answers: ["Commutative Property", "Associative Property", "Distributive Property", "Identity Property"],
      correctAnswer: "Distributive Property",
      explanation: "The distributive property allows us to multiply a sum by multiplying each addend separately and then adding the products."
    },
    {
      question: "What is the value of (5 × 2) × 3?",
      property: "Associative Property",
      answers: ["15", "30", "25", "20"],
      correctAnswer: "30",
      explanation: "Using the associative property: (5 × 2) × 3 = 10 × 3 = 30"
    },
    {
      question: "If a × b = b × a, which property is being demonstrated?",
      property: "Commutative Property",
      answers: ["Commutative Property", "Associative Property", "Distributive Property", "Identity Property"],
      correctAnswer: "Commutative Property",
      explanation: "The commutative property states that changing the order of factors doesn't change the product."
    },
    {
      question: "What is 8 × (2 + 3) equal to?",
      property: "Distributive Property",
      answers: ["40", "24", "16", "48"],
      correctAnswer: "40",
      explanation: "Using the distributive property: 8 × (2 + 3) = (8 × 2) + (8 × 3) = 16 + 24 = 40"
    },
    {
      question: "What property states that any number multiplied by 1 equals itself?",
      property: "Identity Property",
      answers: ["Commutative Property", "Associative Property", "Identity Property", "Zero Property"],
      correctAnswer: "Identity Property",
      explanation: "The identity property of multiplication states that any number multiplied by 1 equals itself."
    }
  ];

  const handleAnswerClick = (answer) => {
    setSelectedAnswer(answer);
    const correct = answer === challengeQuestions[currentQuestion].correctAnswer;
    setIsCorrect(correct);
    
    if (correct) {
      setScore(score + 1);
    }

    setShowExplanation(true);

    setTimeout(() => {
      if (currentQuestion + 1 < challengeQuestions.length) {
        setCurrentQuestion(currentQuestion + 1);
        setSelectedAnswer(null);
        setIsCorrect(null);
        setShowExplanation(false);
      } else {
        setShowScore(true);
      }
    }, 3000);
  };

  const restartChallenge = () => {
    setCurrentQuestion(0);
    setScore(0);
    setShowScore(false);
    setSelectedAnswer(null);
    setIsCorrect(null);
    setShowExplanation(false);
  };

  if (showScore) {
    return (
      <div className="min-h-screen bg-gradient-to-b from-blue-100 to-purple-100 flex flex-col items-center justify-center p-4">
        <div className="bg-white p-8 rounded-lg shadow-lg text-center max-w-md">
          <h2 className="text-3xl font-bold text-blue-800 mb-4">Challenge Complete! 🏆</h2>
          <p className="text-xl mb-6">
            You scored {score} out of {challengeQuestions.length} points!
          </p>
          <div className="space-x-4">
            <button
              onClick={restartChallenge}
              className="bg-blue-600 hover:bg-blue-700 text-white font-bold py-2 px-6 rounded-full"
            >
              Try Again 🔄
            </button>
            <button
              onClick={() => navigate('/')}
              className="bg-purple-600 hover:bg-purple-700 text-white font-bold py-2 px-6 rounded-full"
            >
              Home 🏠
            </button>
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-100 to-purple-100 flex flex-col items-center justify-center p-4">
      <div className="bg-white p-8 rounded-lg shadow-lg max-w-2xl w-full">
        <div className="mb-8">
          <div className="flex justify-between items-center mb-4">
            <span className="text-gray-600">Challenge Question {currentQuestion + 1}/{challengeQuestions.length}</span>
            <span className="text-blue-600 font-bold">Score: {score}</span>
          </div>
          <h2 className="text-2xl font-bold text-gray-800 mb-4">
            {challengeQuestions[currentQuestion].question}
          </h2>
          <p className="text-sm text-gray-600 mb-4">
            Property: {challengeQuestions[currentQuestion].property}
          </p>
        </div>

        <div className="space-y-4">
          {challengeQuestions[currentQuestion].answers.map((answer, index) => (
            <button
              key={index}
              onClick={() => handleAnswerClick(answer)}
              disabled={selectedAnswer !== null}
              className={`w-full p-4 rounded-lg text-left transition-all ${
                selectedAnswer === answer
                  ? isCorrect
                    ? 'bg-green-100 border-2 border-green-500'
                    : 'bg-red-100 border-2 border-red-500'
                  : 'bg-gray-50 hover:bg-gray-100 border-2 border-transparent'
              }`}
            >
              {answer}
            </button>
          ))}
        </div>

        {showExplanation && (
          <div className={`mt-4 p-4 rounded-lg ${
            isCorrect ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'
          }`}>
            <p className="font-medium mb-2">
              {isCorrect ? '✅ Correct!' : '❌ Incorrect!'}
            </p>
            <p>{challengeQuestions[currentQuestion].explanation}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default ChallengePage;
